import React from 'react';
import {connect} from 'react-redux'
import {Link} from 'react-router-dom';
import {  Menu, Layout } from "antd";
import {
    ProfileOutlined,
    AccountBookOutlined,
    HistoryOutlined
  } from "@ant-design/icons";
import { getBookingStart } from '../../redux/booking/booking-action';
  const { Sider } = Layout
class SideBarUser extends React.Component {
    state = {
        collapsed: false
      };

    onCollapse = (collapsed) => {

        this.setState({ collapsed });
    };
    render() {
      const {getBookingStart} = this.props;
        return (
            <Sider
              collapsible
              collapsed={this.state.collapsed}
              onCollapse={this.onCollapse}
            >
          <Menu theme="light"  mode="inline">
            <Menu.Item key="1" icon={<ProfileOutlined />}>
              <Link to ="/user">Your Information</Link>
            </Menu.Item>
            <Menu.Item key="2" icon={<AccountBookOutlined />}>
             <Link to ="/user/booking" onClick={() =>getBookingStart()}> Booking</Link>
            </Menu.Item>
            {/* <Menu.Item icon={<HistoryOutlined />} key="4">
              <Link to ="/user/history"> History</Link>
            </Menu.Item> */}
          </Menu>
        </Sider>
        )
    }
}
const mapDispatchToProps = dispatch => ({
  getBookingStart: () => dispatch(getBookingStart())
})

export default connect(null,mapDispatchToProps)(SideBarUser);
